import React, { useState, useEffect } from 'react';
import { useNavigate, useParams } from 'react-router-dom';

const RegistrationFormPage = () => {
  const navigate = useNavigate();
  const { eventId } = useParams();
  const [eventDetails, setEventDetails] = useState(null);
  const [loading, setLoading] = useState(true);

  const [form, setForm] = useState({
    first_name: '',
    last_name: '',
    event_id: parseInt(eventId)
  });

  useEffect(() => {
    // In a real app, this would fetch data from the API
    // For now, we'll simulate data for the given mock events
    setLoading(true);
    setTimeout(() => {
      if (eventId === '1') {
        setEventDetails({
          id: 1,
          title: 'Tech Conference 2025',
          event_type: 'Conference',
          event_date: '2025-07-15T09:00:00',
          seats: 200
        });
      } else if (eventId === '2') {
        setEventDetails({
          id: 2,
          title: 'Web Development Workshop',
          event_type: 'Workshop',
          event_date: '2025-08-10T14:00:00',
          seats: 30
        });
      } else if (eventId === '3') {
        setEventDetails({
          id: 3,
          title: 'Networking Meetup',
          event_type: 'Meetup',
          event_date: '2025-06-05T18:00:00',
          seats: 50
        });
      } else {
        // Handle event not found
        navigate('/events');
        alert('Event not found');
      }
      setLoading(false);
    }, 500); // Simulate loading delay
  }, [eventId, navigate]);

  const handleChange = (e) => {
    const { name, value } = e.target;
    setForm({
      ...form,
      [name]: value
    });
  };

  const handleSubmit = (e) => {
    e.preventDefault();

    // In a real app, this would call the API
    // For now, simulate a successful registration

    // Navigate to confirmation page
    navigate('/confirmation', {
      state: {
        type: 'registration',
        data: {
          ...form,
          event_title: eventDetails.title,
          event_date: eventDetails.event_date
        }
      }
    });
  };

  if (loading) {
    return (
      <div className="container mx-auto p-4 text-center">
        <p className="text-gray-600">Loading event details...</p>
      </div>
    );
  }

  if (!eventDetails) {
    return (
      <div className="container mx-auto p-4 text-center">
        <p className="text-red-600">Event not found</p>
        <button
          onClick={() => navigate('/events')}
          className="mt-4 bg-blue-500 hover:bg-blue-600 text-white py-2 px-4 rounded"
        >
          Back to Events
        </button>
      </div>
    );
  }

  const formatDate = (dateString) => {
    const options = { 
      year: 'numeric', 
      month: 'long', 
      day: 'numeric',
      hour: '2-digit',
      minute: '2-digit'
    };
    return new Date(dateString).toLocaleDateString(undefined, options);
  };

  return (
    <div className="container mx-auto p-4">
      <h1 className="text-2xl font-bold mb-2">Register for Event</h1>
      <h2 className="text-xl text-gray-600 mb-6">{eventDetails.title}</h2>

      <div className="bg-white rounded-lg shadow-md p-6 mb-6">
        <h3 className="font-bold mb-3">Event Details</h3>
        <p className="mb-1"><span className="font-semibold">Type:</span> {eventDetails.event_type}</p>
        <p className="mb-1"><span className="font-semibold">Date:</span> {formatDate(eventDetails.event_date)}</p>
        <p className="mb-1"><span className="font-semibold">Available Seats:</span> {eventDetails.seats}</p>
      </div>

      <form onSubmit={handleSubmit} className="bg-white rounded-lg shadow-md p-6">
        <div className="mb-4">
          <label htmlFor="first_name" className="block text-gray-700 font-bold mb-2">
            First Name
          </label>
          <input
            type="text"
            id="first_name"
            name="first_name"
            value={form.first_name}
            onChange={handleChange}
            className="w-full px-3 py-2 border rounded-lg focus:outline-none focus:ring-2 focus:ring-blue-500"
            required
          />
        </div>

        <div className="mb-6">
          <label htmlFor="last_name" className="block text-gray-700 font-bold mb-2">
            Last Name
          </label>
          <input
            type="text"
            id="last_name"
            name="last_name"
            value={form.last_name}
            onChange={handleChange}
            className="w-full px-3 py-2 border rounded-lg focus:outline-none focus:ring-2 focus:ring-blue-500"
            required
          />
        </div>

        <div className="flex justify-between">
          <button
            type="button"
            onClick={() => navigate('/events')}
            className="bg-gray-500 hover:bg-gray-600 text-white py-2 px-4 rounded focus:outline-none focus:shadow-outline"
          >
            Cancel
          </button>
          <button
            type="submit"
            className="bg-green-500 hover:bg-green-600 text-white py-2 px-4 rounded focus:outline-none focus:shadow-outline"
          >
            Register
          </button>
        </div>
      </form>
    </div>
  );
};

export default RegistrationFormPage;
